import React from "react";
import { Navigate,Outlet, Route,Routes } from "react-router-dom";
import AuthHandler from "./AuthHandler";

export const PrivateRoute = ({...rest}) => {
    
  return (
    <Routes>
    <Route
    {...rest}
    render = {(props) =>
    AuthHandler.loggedIn() ? <Outlet {...props}/> : <Navigate to='/'/>
    }/> </Routes>
    )
  }
